import React from 'react'

const sampleActivity = [
    {
        id: 1,
        activityName: "run"
    },
    {
        id: 2,
        activityName: "swim"
    }

];

const ActivityList = ({ activity }) => {
    return (
        <select>{activity.map(sampleActivity)}</select>
    )
}

export default ActivityList;
